import React, { Component } from "react";

import { NavLink } from "react-router-dom";
export default class Navigation extends Component {
  render() {
    return (
      <nav class="Navigation">
        <ul class="navigation__list">
          <li class="navigation__item ">
            <NavLink ahref="/" class="navigation__link selected">
              home
            </NavLink>
          </li>
          <li class="navigation__item">
            <NavLink href="portfolio.html" class="navigation__link">
              portfolio
            </NavLink>
          </li>
          <li class="navigation__item">
            <NavLink href="contact.html" class="navigation__link">
              about + contact
            </NavLink>
          </li>
        </ul>
      </nav>
    );
  }
}
